import { Container, Url, Id, DataCreate } from "./styled";
import DateObject from "react-date-object";
const UserAccount = (props) => {
    let Date = new DateObject(props.created_at);
    return (
        <Container>
            <Url>Profile Url : {props.html_url}</Url>
            <Id>Id: {props.id}</Id>
            <DataCreate> Create Data : {props.created_at}</DataCreate>
        </Container>
    );
};

export default UserAccount;
